CREATE TABLE `measurement_results`
(
    `id`                    integer,
    `created_at`            datetime,
    `updated_at`            datetime,
    `deleted_at`            datetime,
    `probe_id`              integer,
    `measurement_id`        integer,
    `measurement_timestamp` integer,
    `ip`                    text,
    `measurement_date`      text,
    `time_average`          real,
    `time_max`              real,
    `time_min`              real,
    PRIMARY KEY (`id`),
    CONSTRAINT `fk_measurement_results_probe` FOREIGN KEY (`probe_id`) REFERENCES `probes` (`probe_id`),
    CONSTRAINT `fk_measurement_results_measurement` FOREIGN KEY (`measurement_id`) REFERENCES `measurements` (`measurement_id`)
);

